import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
const Fetch = require('node-fetch');
const useStyles = makeStyles({
    root: {
        minWidth: 275,
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
});

function fetch() {
    let url = "https://jsonplaceholder.typicode.com/posts";

    let settings = { method: "Get" };
    var post_data = "";
    Fetch(url, settings)
        .then(res => res.json())
        .then((json) => {
            post_data = json;
            //console.log(JSON.stringify(data));
            console.log("_-----------------------_");
            for (var i in post_data) {
                const entry = JSON.stringify(i);
                console.log("------");
                console.log(post_data[i].id);
                console.log("------");
                console.log(post_data[i].title);
                console.log("------");
                console.log(post_data[i].body);
                console.log("_______________________");
            }
            // do something with JSON
        });
}
export default function OutlinedCard() {
    const classes = useStyles();
    let url = "https://jsonplaceholder.typicode.com/posts";
    let settings = { method: "Get" };
    let ids = [];
    let titles = [];
    let bodys = [];
    let response = Fetch(url, settings)
        .then(res => res.json())
        .then((json) => {
            var post_data = json; //console.log(JSON.stringify(data));
            console.log("_-----------------------_");
            for (var i in post_data) {
                const entry = JSON.stringify(i);
                console.log("------");
                console.log(post_data[i].id);
                ids.push(post_data[i].id);
                console.log("------");
                console.log(post_data[i].title);
                titles.push(post_data[i].title);
                console.log("------");
                console.log(post_data[i].body);
                bodys.push(post_data[i].body);
                console.log("_______________________");
            } // do something with JSON
        })
        .catch(error => { alert("server is down") });

    async function fetchdata() {
        let response = await Fetch(url, settings);
        alert(response.status);
        if (response.status === 200) {
            let post_data = await response.json();
            return post_data;
            // handle data
            alert(JSON.stringify(post_data));
            console.log("_-----------------------_");
            for (var i in post_data) {
                const entry = JSON.stringify(i);
                console.log("------");
                console.log(post_data[i].id);
                ids.push(post_data[i].id);
                console.log("------");
                console.log(post_data[i].title);
                titles.push(post_data[i].title);
                console.log("------");
                console.log(post_data[i].body);
                bodys.push(post_data[i].body);
                console.log("_______________________");
            } // do something with JSON
        }
    }

    let card = fetchdata();
    alert(JSON.stringify(card))

    return ( <
        Card className = { classes.root }
        variant = "outlined" >
        <
        CardContent >
        <
        Typography className = { classes.title }
        color = "textSecondary"
        gutterBottom > wtf { ids } <
        /Typography> <
        Typography variant = "h5"
        component = "h2" >
        wtf2 { titles } <
        /Typography>  <
        Typography variant = "body2"
        component = "p" >
        wtf3 { bodys } <
        br / > { '"a benevolent smile"' } <
        /Typography> < /
        CardContent > <
        CardActions >
        <
        Button size = "small" > Learn More < /Button> < /
        CardActions > <
        /Card>
    );
}
